import React from 'react'
import { Header } from './components/header/Header';
import { SectionImg } from './components/sectionimg/SectionImg';
import { Comment } from './data/data'



function App() {
  return (
    <React.Fragment>
      <Header/>
      <SectionImg 
        img={comment.section1.img} 
        title={comment.section1.title} 
        content={comment.section1.content} 
        imgPosition={comment.section1.imgPosition} 
      />
    </React.Fragment>
  );
}

export default App;
